import React from 'react'
import axios from "axios";

const Dashboard = () => {
    let result = "";
    const testQuery = () => {
        axios
            .get("http://localhost:5000/")
            .then((res) => {
                result = res.data;
            });
    };

    return (
        <>
            <h1>Dashboard page</h1>
            <button handleclick={testQuery}>TEST A QUERY</button>
            <p>{result}</p>
        </>
    );
  }

export default Dashboard;
